import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import { toast } from "react-toastify";

function UserList(props) {
    return (
        <table className="table">
            <thead>
                <tr>
                    <th>&nbsp;</th>
                    <th>Name</th>
                    <th>Address</th>
                    <th>Category</th>
                </tr>
            </thead>
            <tbody>
                {props.users.map(user => {
                    return (
                        <tr key={user.id}>
                            <td>
                                <button
                                    className="btn btn-outline-danger"
                                    onClick={() => {
                                        props.createNewChannel(user.id).then(() => {
                                            toast.success("Course deleted.");
                                        });
                                    }}
                                >
                                    CreateChannel
                                </button>
                            </td>
                            <td>
                                {/* <Link to={"/user/" + user.slug}>{user.title}</Link> */}
                                {user.name}
                            </td>
                            <td>{user.address}</td>
                            <td>{user.category}</td>
                        </tr>
                    );
                })}
            </tbody>
        </table>
    );
}

